Breastmilk is the perfect source of early nutrition for babies. The ‘first milk’ – or colostrum - is safe, clean, and contains antibodies that help protect babies against many dangerous infections and diseases.

Yet, the #COVID19 pandemic has caused significant disruptions in breastfeeding support services, while increasing the risk of food insecurity and malnutrition around the world. 

As #WorldBreastfeedingWeek comes to an end, let's remember that each of us can do our part to support breastfeeding including by 

🔵 allowing mothers enough space and time to breastfeed;
🔵 showing encouragement and support;
🔵 providing adequate information and resources on breastfeeding.

@unicef  is actively working to promote breastfeeding as the best source of nourishment for infants and young children, and to ensure that mothers have access to skilled breastfeeding counseling.

